import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 19.2-178 Where prisoner kept when no vacancy in facility or hospital.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-178.md","filePath":"vacode/19.2-178.md"}'),i={name:"vacode/19.2-178.md"},o=a('<h1 id="§-19-2-178-where-prisoner-kept-when-no-vacancy-in-facility-or-hospital" tabindex="-1">§ 19.2-178 Where prisoner kept when no vacancy in facility or hospital. <a class="header-anchor" href="#§-19-2-178-where-prisoner-kept-when-no-vacancy-in-facility-or-hospital" aria-label="Permalink to &quot;§ 19.2-178 Where prisoner kept when no vacancy in facility or hospital.&quot;">​</a></h1><p>When a court shall have entered any of the orders provided for in § <a href="http://law.lis.virginia.gov/vacode/19.2-168.1/" target="_blank" rel="noreferrer">19.2-168.1</a>, <a href="http://law.lis.virginia.gov/vacode/19.2-169.1/" target="_blank" rel="noreferrer">19.2-169.1</a>, <a href="http://law.lis.virginia.gov/vacode/19.2-169.5/" target="_blank" rel="noreferrer">19.2-169.5</a>, or <a href="http://law.lis.virginia.gov/vacode/19.2-169.6/" target="_blank" rel="noreferrer">19.2-169.6</a>, the sheriff of the county or city or the proper officer of the penal institution shall immediately proceed to ascertain whether a vacancy exists at the proper facility or hospital and until it is ascertained that there is a vacancy such person shall be kept in the jail of such county or city or in such custody as the court may order, or in the penal institution in which he is confined, until there is room in such facility or hospital. Any person whose care and custody is herein provided for shall be taken to and from the facility or hospital to which he was committed by an officer of the penal institution having custody of him, or by the sheriff of the county or city whose court issued the order of commitment, and the expenses incurred in such removals shall be paid by such penal institution, county or city.</p><p>Code 1950, § 19.1-236; 1960, c. 366; 1975, c. 495; 1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0645" target="_blank" rel="noreferrer">645</a>; 2010, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0340" target="_blank" rel="noreferrer">340</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0406" target="_blank" rel="noreferrer">406</a>.</p>',3),n=[o];function c(h,s,l,p,f,d){return r(),t("div",null,n)}const u=e(i,[["render",c]]);export{v as __pageData,u as default};
